import React from 'react';
import './App.css';
import Card from 'react-bootstrap/Card';
import ButtonToolbar from 'react-bootstrap/ButtonToolbar';
import ToggleButton from 'react-bootstrap/ToggleButton';
import ToggleButtonGroup from 'react-bootstrap/ToggleButtonGroup';
import FilterPreviousCourses from './FilterPreviousCourses';

class RecommendSidebar extends React.Component {
  constructor(props) {
    super(props);
    this.Fil = new RecommendSidebar();
    this.state = {}
  }

  setPreviousCourses() {
    this.props.setPreviousCourses(this.FilterPreviousCourses.FilterPreviousCourses(this.props.courses, this.props.previousCourseNames));
  }

  render() {
    if (this.state.chips === null) return null;

    return (
      <>
        <Card style={{width: 'calc(20vw - 5px)', marginLeft: '5px', height: 'calc(100vh - 10px)', position: 'fixed'}}>
          <Card.Body>
            <Card.Title>Rate Your Courses!</Card.Title>
          </Card.Body>
        </Card>
      </>
    )
  }
}

export default RecommendSidebar;
